export default function validate(userData) {
    let errors = {};
  const regexEmail = '/^[a-zA-Z0-9]+@[a-zA-Z0-9]+\.[A-Za-z]+$/'
    if(!regexEmail.test(userData.username)) {
      errors.e1 = 'Ingrese un email valido'
    }
    if (!userData.username) {
      errors.e2 = 'El nombre de usuario es obligatorio';
    } 
     if (userData.username.length > 35) {
      errors.e3 = 'El nombre de usuario no debe tener más de 35 caracteres';
    }
  
    if (!userData.password) {
      errors.password = 'La contraseña es obligatoria';
    } else if (!/^(?=.*[0-9])(?=.*[a-zA-Z])([a-zA-Z0-9]{6,10})$/.test(userData.password)) {
      errors.password = 'La contraseña  tiene que tener al menos un número y  una longitud entre 6 y 10 caracteres '
    }
    return errors;
}
